import React from 'react'
import { Route, Switch, Redirect } from 'react-router-dom'
import Dashboard from '../Components/Dashboard'
import EditAccount from '../Components/EditAccount'
import Home from '../Components/Home'
import Login from '../Components/Login'
import Register from '../Components/Register'
import { useState, useHistory, useEffect } from 'react'
import axios from 'axios'
import Explore from '../Components/Explore'


export default function Main() {
    const [loggedInUser, setLoggedInUser] = useState("");


    let history = useHistory();
    useEffect(() => {
        if(sessionStorage.getItem("user_id") == null){
            history.push("/register");
        } else {
            const loggedInUserId = sessionStorage.getItem("user_id");
            const link = "http://localhost:8080/api/users/" + loggedInUserId;
            axios.get(link)
                .then(response => setLoggedInUser(response.data))
                .catch(err => console.log(err));
        }
    })

    return (
        <Switch>
            <Route exact path="/register">
                <Register/>
            </Route>
            <Route exact path="/login">
                <Login/>
            </Route>
            <Route exact path="/editAccount">
                <EditAccount loggedInUser={loggedInUser}/>
            </Route>
            <Route exact path="/home">
                <Home/>
            </Route>
            <Route exact path="/explore">
                <Explore loggedInUser={loggedInUser}/>
            </Route>
            <Route exact path="/">
                <Redirect to="register"/>
            </Route> 
        </Switch>
    )
}
